Armorial bookplate of George Soaper with motto &quot;Esse quam videri&quot;.

 George Soaper was a collector from Stoke, near Guildford (Surrey).  I couldn't find any specific dates for him, but he is recorded as the editor or publisher of a facsimile reprint of &quot;The institucion of a gentleman (1568)&quot;, printed in 1839 by Charles Whittingham. 
The Advertisement is signed: G.S., i.e. George Soaper. 100 copies were printed for presentation only.&quot;

