In pencil: &quot;The Man of Ross&quot;

John Kyrle (1637-1724), known as &quot;the Man of Ross&quot;, was an English philanthropist, born in the parish of Dymock, Gloucestershire, best remembered for the contributions he made to welfare of the small town of Ross-on-Wye in Herefordshire.

<a href="http://viaf.org/viaf/33958781/#Kyrle,_John,_1637-1724" rel="nofollow">Kyrle, John, 1637-1724</a>

On the sides: &quot;Dear Sister ... John Archer&quot;
Lower margin: &quot;Poor Nell I Love Thee Dearly&quot;

The inscription probably belongs to John Archer (1661-1704), brother of Eleanor Archer (1660-1694), whose name could have been abbreviated Nell.

Autograph of John Willi[am] Archer and several inscriptions:
&quot;John Mary&quot;
&quot;Margaret, I am very sorry&quot;
&quot;John [son?] Archer
E. Wrottesley&quot;

Quite possibly the autograph of Sir John Archer (ca. 1621?- 1682) an English judge, father to Eleanor Archer (1660-1694), who later became Wrottesley by marriage and John Archer (1661-1704), who died without issue.

Sir John Archer was married three times: first to Eleanor Curzon, then to Margaret Saville and Mary Wood. The names of his last two wives could explain the inscriptions in this book.

