&quot;Ex libris Fairfax of Cameron&quot; with motto &quot;Fare, Fac&quot; (Speak, Do).

Armorial bookplate of the Barons Fairfax of Cameron. I'm not exactly sure to which baron the bookplate belongs, but it could be  Albert Kirby Fairfax, 12th Lord Fairfax of Cameron (1870- 1939). The Fairfax family coat of arms can be seen in <a href="http://books.google.com/books?id=DuwDAAAAQAAJ&amp;pg=PA298&amp;lpg=PA298&amp;dq=" rel="nofollow">Debrett's Peerage of England, Scotland, and Ireland</a>.

The library of the Fairfax family included over 5000 pamphlets and tracts from the English Civil War when Thomas Fairfax (1612-71) commanded the New Model Army and defeated Charles I at The Battle of Naseby. Sothebys described this Library as &quot;undoubtedly the most important and largest collection of such material ever to be offered for sale at auction.&quot;

