Armorial bookplate of &quot;James Bindley Esq. M.A.F.S.A. Ginchley Middlesea.&quot;

James Bindley (1737–1818) was an English official and antiquary, known as a book collector. Bindley formed a collection of rare books, engravings, and medals, which were sold by auction after his death. Two series of sales, by Samuel Sotheby and Robert Harding Evans, raised over £20,000.

<a href="http://viaf.org/viaf/121937048/#Bindley,_James,_1739-1818" rel="nofollow">Bindley, James, 1739-1818</a>

